-- ----------------------------
-- Procedure structure for daily_collection
-- ----------------------------
DROP PROCEDURE IF EXISTS `daily_collection`;
delimiter ;;
CREATE PROCEDURE `daily_collection`()
BEGIN

    
	SELECT UUID(), user_name, IFNULL(user_ip, '0000'), IFNULL(school_id, '0000'), IFNULL(course_id, '0000'), IFNULL(class_id, '0000'), chapter_id,  create_date,
	-- group_concat(duration) As duration, group_concat(file_upload_num) As file_upload_num,
	COUNT(user_name) As exp_num,
	sum(duration) As duration_sum,
    sum(file_upload_num) As file_upload_num_sum
    -- into @userName, @userIP, @classID, @chapterID, @schoolID,@dateOfRecord,
	-- 	@expNum, @durationSum, @fileUploadNumSum
	FROM hdu.cb_use_time
	WHERE 
		create_date = current_date()  -- 今天的
		-- and create_clock between DATE_SUB(NOW(), INTERVAL 48 HOUR) and NOW()  -- 48小时内的
	GROUP BY user_name , class_id , chapter_id , school_id
	HAVING COUNT(*) >= 1;
	
    -- SELECT id,  duration, file_upload_num 
    -- FROM hdu.daily_every_2hours_user_collection
    

END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for daily_collection_class
-- ----------------------------
DROP PROCEDURE IF EXISTS `daily_collection_class`;
delimiter ;;
CREATE PROCEDURE `daily_collection_class`()
BEGIN
	SELECT UUID(), school_id, class_id,  date_of_record,
	sum(exp_num) As exp_num,
	sum(duration) As duration_sum,
    sum(file_upload_num) As file_upload_num_sum
	FROM hdu.daily_collection_user
	WHERE 
		date_of_record = current_date()
	GROUP BY class_id, school_id
	HAVING COUNT(*) >= 1;
END
;;
