delimiter ;;
CREATE PROCEDURE `daily_every_2hours_class_collection`()
BEGIN
truncate daily_every_2hours_class_collection;
SELECT 
UUID(),
school_id, 
class_id,
date_of_record,
sum(ifnull(SUBSTRING_INDEX(duration,'/',1),0)) as duration_p1,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/', 2),'/',-1),0)) as duration_p2,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/', 3),'/',-1),0)) as duration_p3,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/', 4),'/',-1),0)) as duration_p4,
