sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/', 9),'/',-1),0)) as duration_p9,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/',10),'/',-1),0)) as duration_p10,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/',11),'/',-1),0)) as duration_p11,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(duration,'/',12),'/',-1),0)) as duration_p12,
sum(ifnull(SUBSTRING_INDEX(exp_num,'/',1),0)) as exp_num_p1,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 2),'/',-1),0)) as exp_num_p2,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 3),'/',-1),0)) as exp_num_p3,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 4),'/',-1),0)) as exp_num_p4,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 5),'/',-1),0)) as exp_num_p5,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 6),'/',-1),0)) as exp_num_p6,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 7),'/',-1),0)) as exp_num_p7,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 8),'/',-1),0)) as exp_num_p8,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/', 9),'/',-1),0)) as exp_num_p9,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/',10),'/',-1),0)) as exp_num_p10,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/',11),'/',-1),0)) as exp_num_p11,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(exp_num,'/',12),'/',-1),0)) as exp_num_p12,
sum(ifnull(SUBSTRING_INDEX(file_upload_num,'/',1),0)) as file_upload_num_p1,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 2),'/',-1),0)) as file_upload_num_p2,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 3),'/',-1),0)) as file_upload_num_p3,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 4),'/',-1),0)) as file_upload_num_p4,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 5),'/',-1),0)) as file_upload_num_p5,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 6),'/',-1),0)) as file_upload_num_p6,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 7),'/',-1),0)) as file_upload_num_p7,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 8),'/',-1),0)) as file_upload_num_p8,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/', 9),'/',-1),0)) as file_upload_num_p9,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/',10),'/',-1),0)) as file_upload_num_p10,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/',11),'/',-1),0)) as file_upload_num_p11,
sum(ifnull(SUBSTRING_INDEX(SUBSTRING_INDEX(file_upload_num,'/',12),'/',-1),0)) as file_upload_num_p12
FROM hdu.daily_every_2hours_user_collection
group by class_id, date_of_record
);
END
;;
