DROP PROCEDURE IF EXISTS `monthly_collection_class`;
delimiter ;;
CREATE PROCEDURE `monthly_collection_class`()
BEGIN
	SELECT UUID(), school_id, class_id, DATE_SUB(curdate(),INTERVAL 1 DAY), -- 昨天日期
	sum(exp_num) As exp_num,
	sum(duration) As duration_sum,
    sum(file_upload_num) As file_upload_num_sum
	FROM hdu.monthly_collection_user
	WHERE
		date_of_last = DATE_SUB(curdate(),INTERVAL 1 DAY)
        -- DATE_SUB(CURDATE(), INTERVAL 7 DAY) <= date(date_of_record)
	group by school_id, class_id
	HAVING COUNT(*) >= 1;

END
;;
