CREATE PROCEDURE `monthly_collection_total`()
BEGIN
	SELECT UUID(), DATE_SUB(curdate(),INTERVAL 1 DAY), -- 昨天日期
	sum(exp_num) As exp_num,
	sum(duration) As duration_sum,
    sum(file_upload_num) As file_upload_num_sum
	FROM hdu.monthly_collection_school
	WHERE
		date_of_last = DATE_SUB(curdate(),INTERVAL 1 DAY) -- 昨天日期
        -- DATE_SUB(CURDATE(), INTERVAL 7 DAY) <= date(date_of_record)
	HAVING COUNT(*) >= 1;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for monthly_collection_user
-- ----------------------------
DROP PROCEDURE IF EXISTS `monthly_collection_user`;
delimiter ;;
CREATE PROCEDURE `monthly_collection_user`()
BEGIN
	SELECT UUID(), user_name, user_ip, school_id, class_id, DATE_SUB(curdate(),INTERVAL 1 DAY), -- 昨天日期（月末）
	sum(exp_num) As exp_num,
	sum(duration) As duration_sum,
    sum(file_upload_num) As file_upload_num_sum
	FROM hdu.daily_collection_user
	WHERE
		date_of_record
			BETWEEN DATE_FORMAT(DATE_ADD(NOW(),INTERVAL -1 MONTH),'%Y-%m-01') 
					AND  DATE_FORMAT(NOW(),'%Y-%m-01')
        -- DATE_SUB(CURDATE(), INTERVAL 7 DAY) <= date(date_of_record)
	group by school_id, class_id, user_name, user_ip
	HAVING COUNT(*) >= 1;

END
;;
delimiter ;

