-- ----------------------------
-- Procedure structure for total_user_chapter_collection
-- ----------------------------
DROP PROCEDURE IF EXISTS `total_user_chapter_collection`;
delimiter ;;
CREATE PROCEDURE `total_user_chapter_collection`()
BEGIN
	-- 如果有这条记录 就累加
    UPDATE hdu.total_user_chapter_collection t1 JOIN hdu.daily_collection t2 
	SET t1.exp_num = t1.exp_num + t2.exp_num, t1.duration = t1.duration + t2.duration, t1.file_upload_num = t1.file_upload_num + t2.file_upload_num
    WHERE t2.date_of_record = DATE_SUB(curdate(),INTERVAL 1 DAY) -- 昨天 
		and t1.user_name = t2.user_name
        and t1.class_id = t2.class_id
        and t1.school_id = t2.school_id
        and t1.chapter_id = t2.chapter_id;
    -- 如果没有这条记录 就插入
	SELECT UUID(), user_name, user_ip, class_id, school_id, chapter_id, exp_num, duration, file_upload_num
	FROM hdu.daily_collection
	WHERE 
		-- date_of_record = '2020-06-01'
		date_of_record = DATE_SUB(curdate(),INTERVAL 1 DAY) -- 昨天
		and not exists (
			select * 
			from hdu.total_user_chapter_collection 
			where hdu.total_user_chapter_collection.user_name = hdu.daily_collection.user_name 
				and hdu.total_user_chapter_collection.class_id = hdu.daily_collection.class_id 
              and hdu.total_user_chapter_collection.school_id = hdu.daily_collection.school_id 
              and hdu.total_user_chapter_collection.chapter_id = hdu.daily_collection.chapter_id
			);

END
;;
delimiter ;

